	public void xtestParsePersoDataToXml() {
		PersoManager manager = new PersoManager();
		try {			
			PersonalizationData fieldInfoData = this.getPersonalizationData();

			String persoDataXml = manager.generateOutputXml(fieldInfoData);
		
			log("[PersoData] xml: " + persoDataXml);
		} catch (Exception e) {
			e.printStackTrace();
			Assert.fail();
		}
	}
	
	public void testSplit() {
		String docType = "MNU_CBEFF";
		String minutiaFormat = StringUtils.substringAfter(docType, "MNU_");
		
		System.out.println("Input: "+docType+"\t Output: "+minutiaFormat);
		
		docType = "MNU";
		minutiaFormat = StringUtils.substringAfter(docType, "MNU_");
		
		System.out.println("Input: "+docType+"      \t Output: "+minutiaFormat);
	}

	
	public static void log(String message) {
		System.out.println("<<< "+message+" >>>");
	}
	
